import React from "react";
import {NavLink} from "react-router-dom";
import classes from '../Dialogs.module.css'
import state from '../../StateComponents/State'

export const DialogsItem = (props) => {

    let dialogsName = state.dialogsPage.dialogs.name
    let dialogsId = state.dialogsPage.dialogs.id

    return (
        <li className={classes.dialogsLink}><NavLink id={dialogsId}/>{dialogsName}</li>
    )
}
